import './App.css';
import {BrowserRouter} from 'react-router-dom'

function App() {
  return (

    <div className="App">
      <BrowserRouter>
        <h1>Conversion Site Landing Page</h1>
        </BrowserRouter>
    </div>

  );
}


export default App;
